import React from 'react';
import '../../App.css';
import './Section2.css';

function Section2() {
  const isMobile = /Mobi/.test(navigator.userAgent);

  if(isMobile){
    return (
      <div className="about-me-container">

      </div>
    );
  }
  return (

    <div className='MeSection'>
        <section>
            <img src="images/BrianPic.jpg" alt="" />

        </section>
        <section>
            <li>

            </li>
        </section>
    </div>
  );
}

export default Section2;
